query:
fragment Money on Money {
  amount
  currency
  __typename
}

fragment ProductVariantAttributesFragment on Product {
  id
  attributes {
    attribute {
      id
      slug
      name
      inputType
      valueRequired
      values {
        id
        name
        slug
        __typename
      }
      __typename
    }
    values {
      id
      name
      slug
      __typename
    }
    __typename
  }
  productType {
    id
    variantAttributes {
      id
      name
      values {
        id
        name
        slug
        __typename
      }
      __typename
    }
    __typename
  }
  pricing {
    priceRangeUndiscounted {
      start {
        gross {
          ...Money
          __typename
        }
        __typename
      }
      stop {
        gross {
          ...Money
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

fragment WarehouseFragment on Warehouse {
  id
  name
  __typename
}

query CreateMultipleVariantsData($id: ID!) {
  product(id: $id) {
    ...ProductVariantAttributesFragment
    __typename
  }
  warehouses(first: 20) {
    edges {
      node {
        ...WarehouseFragment
        __typename
      }
      __typename
    }
    __typename
  }
}
